import React from "react";
import P, { Size, Weight } from "../components/atoms/P/P";
import Button from "../components/atoms/Button/Button";

const Home = () => {
  return (
    <div>
      <P size={Size.m} weight={Weight.m}>
        가모라~
      </P>
      <Button>버튼</Button>
    </div>
  );
};

export default Home;
